import react from "react";
import { Button, Navigation } from "@mui/material";



//Home Page
class Dashboard extends react.Component {
    //Display the component in the screen
    render() {

        <div className="dashboard-container">

        </div>
        return (
            <Button size="large" variant="contained"> Test Button</Button>
        );
    };
}


class NavigationMenu extends react.Component {
    render() {
        return (
            null
        );
    }
}




export default Dashboard;
